import React from 'react';
import rectangles from "./rectangles.module.css";

class Rectangles extends React.Component {
    render() {
        return (
            <>
            <div className = {rectangles.Rectangle1}></div>
            <div className = {rectangles.Rectangle2}></div>
            <div className = {rectangles.Rectangle3}></div>
            <div className = {rectangles.Rectangle4}></div>
            <div className = {rectangles.Rectangle5}></div>
            <div className = {rectangles.Rectangle6}></div>
            <div className = {rectangles.Rectangle7}></div>
            <div className = {rectangles.Rectangle8}></div>
            <div className = {rectangles.Rectangle9}></div>
            <div className = {rectangles.Rectangle10}></div>
            <div className = {rectangles.Rectangle11}></div>
            <div className = {rectangles.Rectangle12}></div>
            <div className = {rectangles.Rectangle13}></div>
            <div className = {rectangles.Rectangle14}></div>
            <div className = {rectangles.Rectangle15}></div>
            </>
          )
    }
}

export default Rectangles;
